import React from 'react';
import PropTypes from 'prop-types';

function JobCard(props) {
  const { job } = props;
  const { jobTitle, companyName, jobdesc } = job;

  return(
    <div className='jobCard'>
      <h1>{jobTitle}</h1>
      <h3>{companyName}</h3>
      <p>{jobdesc}</p>
    </div>
  );
}

JobCard.propTypes = {
  job: PropTypes.object,
}.isRequired;

export default JobCard;
